//STYLES
import styles from './Feed.module.css'



const CreatePost = () => {
    return (
      <div className={styles.createPost_container}>
        <div className={styles.userImage_container}> user image </div>
        <div className={styles.form_container}>
          <form className={styles.createPost_form}>
            <input type="textarea" className={styles.textarea_input}></input>
            <button className={styles.createPost_btn}> create </button>
          </form>
        </div>
      </div>
    );
}

export default CreatePost;
